import React from 'react';
import styled from 'styled-components/macro';

import CategoryButton from './CategoryButton.js';
import categories from './data/categories.js';

import vegetablesImage from './images/vegetables.jpg';
import fruitImage from './images/fruit.jpg';
import milkImage from './images/milk.jpg';
import cookingImage from './images/cooking.jpg';
import breakfastImage from './images/breakfast.jpg';
import coldCutsImage from './images/coldCuts.jpg';
import beveragesImage from './images/beverages.jpg';
import snacksImage from './images/snacks.jpg';
import instantImage from './images/instant.jpg';
import frozenImage from './images/frozen.jpg';
import bodyCareImage from './images/bodyCare.jpg';
import babyImage from './images/baby.jpg';
import houseCleaningImage from './images/houseCleaning.jpg';
import nonFoodImage from './images/nonFood.jpg';

// import Overlay from './Overlay.js';

export default function CategoryButtonsPage({children, makeAppear, makeAppearCategory})
  {


  return (
    <div>
      <Spacer />
        <CategoryButtonArea >
          <CatButton className="category0" onClick={() => makeAppear(0)}>{categories[0]}</CatButton>
          <CatButton className="category1" onClick={() => makeAppear(1)}>{categories[1]}</CatButton>
          <CatButton className="category2" onClick={() => makeAppear(2)}>{categories[2]}</CatButton>
          <CatButton className="category3" onClick={() => makeAppear(3)}>{categories[3]}</CatButton>
          <CatButton className="category4" onClick={() => makeAppear(4)}>{categories[4]}</CatButton>
          <CatButton className="category5" onClick={() => makeAppear(5)}>{categories[5]}</CatButton>
          <CatButton className="category6" onClick={() => makeAppear(6)}>{categories[6]}</CatButton>
          <CatButton className="category7" onClick={() => makeAppear(7)}>{categories[7]}</CatButton>
          <CatButton className="category8" onClick={() => makeAppear(8)}>{categories[8]}</CatButton>
          <CatButton className="category9" onClick={() => makeAppear(9)}>{categories[9]}</CatButton>
          <CatButton className="category10" onClick={() => makeAppear(10)}>{categories[10]}</CatButton>
          <CatButton className="category11" onClick={() => makeAppear(11)}>{categories[11]}</CatButton>
          <CatButton className="category12" onClick={() => makeAppear(12)}>{categories[12]}</CatButton>
          <CatButton className="category13" onClick={() => makeAppear(13)}>{categories[13]}</CatButton>
          <CatButton className="category14" onClick={() => makeAppear(14)}>{categories[14]}</CatButton>
        </CategoryButtonArea>
    </div>
  )
}

const CatButton = styled.button`
  width: 24vw;
  height: 24vw;
  border-radius: 5px;
  font-size: 1.1rem;
  &.category0 {
    background-image: url({vegetablesImage});
  }
`

const CategoryButtonArea = styled.div`
  display: grid;
  color: white;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
  grid-template-columns: 1fr 1fr 1fr;
  justify-items: center;
  gap: 30px 20px;
  margin-top: 20vw;
  margin-bottom: 10vw;
  background-color: rgba(0,0,0,0);
  &>.category0 {
    background: url("/images/vegetables.jpg");
  }
`

const Spacer = styled.div`
  height: 10vw;
  opacity: 0;
`
